description:
Incredible Places

Nature Documentary hosted by Ed Harris and Liam Neeson, published by Freeman Films in 2013 - English narration


Information
------------------------------

Incredible Places Triple Feature
This collection of nature documentaries highlights a variety of wonders of the natural world, including the legendary Nile, deep sea volcanoes, and the little seen crevasses and rooms hidden deep within the ice caves of Greenland. DVD Release Date: March 26, 2013




6) Extra The Making Of:  Journey into Amazing Caves 
Journey Into Amazing Caves is a visceral, suspenseful expedition with a new breed of scientists who boldly explore places once thought off-limits to human presence. Join Dr. Hazel Barton and Nancy Aulenbach 
